var AUTH_TOKEN = ''

async function fetchtoken(){
    const response = await fetch("https://music.apple.com/us/album/positions-deluxe-edition/1553944254");
    let text = await response.text();
    const jspathMatch = text.match(/crossorigin src=\"(\/assets\/index.+?\.js)\"/);
    if (jspathMatch) {
        const jspath = jspathMatch[1];
        const jsResponse = await fetch("https://music.apple.com" + jspath);
        const rawtxt = await jsResponse.text();
        const tknMatch = rawtxt.match(/(eyJhbGc.+?)"/);
        AUTH_TOKEN = `Bearer ${tknMatch[1]}`
    }
    console.log("Token", AUTH_TOKEN);

    waitForElm('#scrollable-page > main > div > div:nth-child(1) > div > div').then((elm) => {
        console.log('Element is ready');
        populate();
    });
}

fetchtoken()

let audioTraits = []
const album_xpath = '//*[@id="scrollable-page"]/main/div/div[1]/div/div/div[1]/div[3]'
const video_xpath = '//*[@id="scrollable-page"]/main/div/div[1]/div/div/div/div[2]/div[1]'

const logo = {
    "atmos": "data:image/svg+xml;base64,",
    "lossless": "data:image/svg+xml;base64,",
    "hi-res-lossless": "data:image/svg+xml;base64,",
    "adm": "data:image/svg+xml;base64,",
    "4k": "data:image/svg+xml;base64,",
}

function getElementByXpath(path) {
    return document.evaluate(path, document, null, XPathResult.FIRST_ORDERED_NODE_TYPE, null).singleNodeValue;
}
  
function insert_html(xpath) {
    let str = '<br><p id="custom_formats">'
    audioTraits.forEach(e => {
        if (e != 'spatial' && e != 'lossy-stereo') {
            str += `<img height = 25 src = "${logo[e]}">                             ` 
        }
    });
    //str += audioTraits.join(" | ");
    str += '</p>';
    // console.log(str);
    let selector = getElementByXpath(xpath);
    console.log(selector);
    selector.insertAdjacentHTML("afterend", str);
    console.log("inserted");
}


async function populate() {
    let url = window.location.href;
    console.log("Running ext for ", url)
    let matchResult = url.match(/https:\/\/music.apple.com\/(\w\w)\/(album|music-video)\/.+\/(\d+)/);
    let region = matchResult[1];
    let type = matchResult[2];
    let contentid = matchResult[3];
    let src = document.documentElement.innerHTML

    const result = await fetch(`https://amp-api.music.apple.com/v1/catalog/${region}/${type}s/${contentid}`, {
        "headers": {
            "authorization": AUTH_TOKEN
        },
        "referrer": "https://music.apple.com/",
        "referrerPolicy": "strict-origin-when-cross-origin",
        "body": null,
        "method": "GET",
        "mode": "cors",
        "credentials": "include"
    });

    // console.log(await result.text());
    var json = await result.json();
    if (type == "album") {
        let albumId = json.data[0].id;
        audioTraits = await json.data[0].attributes.audioTraits;
        if (json.data[0].attributes.isMasteredForItunes == true) {
            audioTraits.push("adm");
        }
        console.log(audioTraits);
        insert_html(album_xpath);
    }

    else if(type == "music-video"){
        audioTraits = []
        if (json.data[0].attributes.has4K == true) {
            audioTraits.push("4k");
        }
        insert_html(video_xpath);
    }
}

function waitForElm(selector) {
    return new Promise(resolve => {
        if (document.querySelector(selector)) {
            return resolve(document.querySelector(selector));
        }

        const observer = new MutationObserver(mutations => {
            if (document.querySelector(selector)) {
                resolve(document.querySelector(selector));
                observer.disconnect();
            }
        });

        observer.observe(document.body, {
            childList: true,
            subtree: true
        });
    });
}

let lastUrl = location.href;
new MutationObserver(() => {
    const url = location.href;
    if (url !== lastUrl) {
        lastUrl = url;
        //setTimeout(codec, 5000);
        waitForElm('#scrollable-page > main > div > div:nth-child(1) > div > div').then((elm) => {
            console.log('Changed page');
            populate();
        });
    }
}).observe(document, { subtree: true, childList: true });